window.bookSummaryJSON = "<p>\"Do you know me? I am Beelzebub, Lord of the Flies, Prince of Hell, second only to Satan in the infernal hierarchy. The Devil, you say? Yes, I'm one of those too.\" </p> <p>Here in one laugh-out-loud volume is the life of Beezy, Satan's BFF, and one of the most popular characters in the Circles in Hell universe. Over 14 billion years in the making, <i>Beelzebub: A Memoir </i>is the ultimate backstory. </p> <p>Beelzebub is the latest novel in the best-selling fantasy comedy series, Circles in Hell. CIH has been compared to other comic works of \"Hell fiction\", such as <i>The Screwtape Letters</i> and <i>Good Omens</i>, and to the paranormal humor of Tom Holt, Christopher Moore, and Douglas Adams. </p> <p>For listeners new to Circles in Hell, <i>Beelzebub: A Memoir </i>is an excellent introduction. For those who have listened to other titles in the series, here is a chance to spend quality time with some of your favorite devils, demons, saints, and sinners. And one big bat!</p>"; 
